using AD_Dataverse_Framework;
using Microsoft.Xrm.Sdk;
using Microsoft.Xrm.Sdk.Query;
using System;
using System.Collections.Generic;
using System.Configuration;
using System.Linq;
using System.Net;
using System.Text;
using System.Threading.Tasks;

namespace DataverseOperations_Console
{
    internal class Program
    {
        static Guid createdRecordId;
        static void Main(string[] args)
        {
            SetConnection();
            CreateProductExample();
            //RetrieveProductExample();
            //CreateExample();
            //RetrieveExample();
            //RetrieveMultipleExample();
            //UpdateExample();
            //RetrieveExample();
            //AssociateExample();
            //BulkCreate();
            Console.ReadLine();
        }

        private static void SetConnection()
        {
            DataverseOperation_WebApi.applicationUserClientId = ConfigurationManager.AppSettings["clientId"].ToString();
            DataverseOperation_WebApi.applicationUserClientSecret = ConfigurationManager.AppSettings["secretKey"].ToString();
            DataverseOperation_WebApi.dataverseURL = ConfigurationManager.AppSettings["dataverseURL"].ToString();
        }

        private static void CreateExample()
        {
            var myContact = new Entity("contact");
            myContact.Attributes["lastname"] = "Dsouza";
            myContact.Attributes["firstname"] = "Anthony";
            myContact.Attributes["jobtitle"] = "Consultant";
            createdRecordId = DataverseOperation_WebApi.CreateRecord(myContact);
            Console.WriteLine("Contact create with ID - " + createdRecordId);
            //Console.ReadLine();
        }

        private static void CreateProductExample()
        {
            var myProduct = new Entity("product");
            myProduct.Attributes["productnumber"] = "Prod 11121";
            myProduct.Attributes["name"] = "Wheels 2";
            myProduct.Attributes["description"] = "Toyota Wheel12s";
            myProduct.Attributes["quantitydecimal"] = 2;
            myProduct.Attributes["defaultuomid"] = new EntityReference("uom", new Guid("7bb0cf51-6046-4383-ac09-14a377e7e0db"));
            myProduct.Attributes["defaultuomscheduleid"] = new EntityReference("uomschedule", new Guid("633d4550-2637-464b-a6b3-1567102ee7f2"));
            //myProduct.Attributes["entityimage"] = System.IO.File.ReadAllBytes();
            byte[] imgData;
            using (WebClient webClient = new WebClient())
            {
                imgData = webClient.DownloadData("https://www.autoo.com.br/fotos/2016/10/960_720/STD_31102016_4197_960_720.jpg");

            }

            // var imgByte = "";
            myProduct.Attributes["entityimage"] = imgData;
            var prodId = DataverseOperation_WebApi.CreateRecord(myProduct);
            Console.WriteLine("Product create with ID - " + prodId);
        }

        private static void RetrieveProductExample()
        {
            string[] cols = { "name", "productnumber", "defaultuomscheduleid", "entityimage" };
            Entity contact = DataverseOperation_WebApi.RetrieveSingleRecord("product", new Guid("97e0085e-d205-ed11-82e6-000d3af2c323"), cols);
            Console.WriteLine("Contact lastname is - " + contact.Attributes["name"]);
        }


        private static void RetrieveExample()
        {
            string[] cols = { "firstname", "lastname" };
            Entity contact = DataverseOperation_WebApi.RetrieveSingleRecord("contact", createdRecordId, cols);
            Console.WriteLine("Contact lastname is - " + contact.Attributes["lastname"]);
            //Console.ReadLine();
        }

        private static void RetrieveMultipleExample()
        {
            string[] cols = { "firstname", "lastname" };
            FilterExpression fe = new FilterExpression();
            fe.AddCondition("createdon", ConditionOperator.Today);
            EntityCollection contact = DataverseOperation_WebApi.RetrieveMultipleRecordFromCRM("contact", fe, cols);
            Console.WriteLine("Total Contact Created Today - " + contact.Entities.Count());
            //Console.ReadLine();
        }

        private static void UpdateExample()
        {
            Entity entContact = new Entity("contact");
            entContact.Id = createdRecordId;
            entContact.Attributes["lastname"] = "Desouza";
            DataverseOperation_WebApi.UpdateRecord(entContact);
            Console.WriteLine("Contact lastname updated");
            //Console.ReadLine();
        }


        private static void AssociateExample()
        {
            Entity lead = new Entity("lead");
            lead.Attributes["lastname"] = "Lead Dsouza";
            var recordGuid = DataverseOperation_WebApi.CreateRecord(lead);
            Console.WriteLine("Lead Generated with Id " + recordGuid);

            string[] cols = { "firstname", "lastname" };
            Entity retLead = DataverseOperation_WebApi.RetrieveSingleRecord("lead", recordGuid, cols);
            Console.WriteLine("Lead lastname is - " + retLead.Attributes["lastname"]);

            DataverseOperation_WebApi.Associate("contact", createdRecordId, "lead_parent_contact", retLead, recordGuid);
            Console.WriteLine("Contact & Lead Associated");
            //Console.ReadLine();
        }

        public static void BulkCreate()
        {
            Entity acc1 = new Entity("contact");
            acc1.Attributes["lastname"] = "Mhatre";
            acc1.Attributes["firstname"] = "Rajas";
            Entity acc2 = new Entity("contact");
            acc2.Attributes["lastname"] = "Chawan";
            acc2.Attributes["firstname"] = "Kamlesh";

            List<Entity> entityList = new List<Entity>();
            entityList.Add(acc1); entityList.Add(acc2);

            DataverseOperation_WebApi.ExecuteMultiple(AD_Dataverse_Framework.Helper.BulkAction.Create, entityList);
            Console.WriteLine("Contact & Lead Associated");

        }
    }
}
